INSERT INTO `wp_bookly_services` (`id`, `category_id`, `type`, `title`, `attachment_id`, `duration`, `slot_length`, `price`, `color`, `deposit`, `capacity_min`, `capacity_max`, `waiting_list_capacity`, `one_booking_per_slot`, `padding_left`, `padding_right`, `info`, `start_time_info`, `end_time_info`, `same_staff_for_subservices`, `units_min`, `units_max`, `package_life_time`, `package_life_time_type`, `package_size`, `package_unassigned`, `appointments_limit`, `limit_period`, `staff_preference`, `staff_preference_settings`, `recurrence_enabled`, `recurrence_frequencies`, `time_requirements`, `collaborative_equal_duration`, `online_meetings`, `final_step_url`, `wc_product_id`, `wc_cart_info_name`, `wc_cart_info`, `min_time_prior_booking`, `min_time_prior_cancel`, `gateways`, `visibility`, `position`) VALUES
(1, 1, 'simple', 'Фотосессия в стиле gothic', NULL, 7200, 'default', 30.00, '#0a0000', '100%', 1, 1, NULL, 0, 0, 0, 'Устав от глянца и гламура, современная фотография всё чаще смотрит в сторону мрачной эстетики Dark Art. Фотосессия в стиле готика – это экстравагантное великолепие в темных тонах. Необычные костюмы из шёлка, бархата, кожи и парчи с использованием кружев. Торжественно строгие интерьеры с высокими окнами и стрельчатыми арками. Обилие природных материалов: камня, металла, натуральных тканей. Если вы хотите получить действительно оригинальные фотоснимки, то данный стиль для этой цели идеален.', NULL, NULL, 0, 1, 1, NULL, 'first_booking', NULL, 0, NULL, 'off', 'most_expensive', '{}', 1, 'daily,weekly,biweekly,monthly', 'required', 0, 'off', '', 0, NULL, NULL, NULL, NULL, NULL, 'public', 1),
(2, 3, 'simple', 'Фотосессия в стиле fantasy', NULL, 7200, 'default', 35.00, '#2014EF', '100%', 1, 1, NULL, 0, 0, 0, 'Стиль fantasy является направлением литературного жанра, который восходит корнями к рассказам фольклора и древних мифов. Образом фэнтези всегда была природа, которая подразумевала собой наличие драконов, эльфов и других невероятных героев. Гармонично вписывались в мир огромные замки и дворцы, где жили подобные образы. Fantasy всегда описывал прекрасную жизнь, где царило волшебство, трагичность и красота. ', NULL, NULL, 0, 1, 1, NULL, 'first_booking', NULL, 0, NULL, 'off', 'most_expensive', '{}', 1, 'daily,weekly,biweekly,monthly', 'required', 0, 'off', '', 0, '', '', NULL, NULL, NULL, 'public', 2);
INSERT INTO `wp_bookly_shop` (`id`, `plugin_id`, `type`, `highlighted`, `priority`, `demo_url`, `title`, `slug`, `description`, `url`, `icon`, `image`, `price`, `sales`, `rating`, `reviews`, `published`, `seen`, `created_at`) VALUES
(1, 7226091, 'plugin', 1, 100, NULL, 'Bookly Pro', 'bookly-addon-pro', 'Bring appointment scheduling process to the next level with Bookly Pro (Add-on). Pro version turns Bookly plugin into the professional appointment management system. Unlock Advanced Customer management, Service provider management, Services management, Email and SMS notifications, Booking management capabilities. Connect payment gateways and modify Pro version with other add-ons available only with Bookly Pro and more.', 'https://codecanyon.net/item/bookly-booking-plugin-responsive-appointment-booking-and-scheduling/7226091', 'https://s3.envato.com/files/437889706/bookly-pro-icon80x80.png', 'https://s3.envato.com/files/549324856/CodeCanyon-main-banner-55K%20(1).jpg', 99.00, 55581, 4.54, 1166, '2014-04-12 17:14:52', 1, '2025-01-22 09:36:56'),
(2, 13903524, 'plugin', 0, 0, NULL, 'Bookly Multisite (Add-on)', 'bookly-addon-multisite', 'Bookly Multisite (Add-on) enables you to use a single instance of the Bookly plugin across your entire Multisite network. This means that each site within your network will have its own unique list of services, staff members, appointments, and settings. It’s an efficient and convenient way to manage your bookings across multiple sites from a single point of access.', 'https://codecanyon.net/item/bookly-multisite-addon/13903524', 'https://s3.envato.com/files/437364499/icon80x80.png', 'https://s3.envato.com/files/437364501/Multisite-590x300.jpg', 49.00, 729, 5.00, 9, '2015-12-04 16:38:03', 1, '2025-01-22 09:36:56'),
(3, 15552320, 'plugin', 0, 0, NULL, 'Bookly Service Extras (Add-on)', 'bookly-addon-service-extras', 'Bookly Service Extras (Add-on) allows you to offer extra items, services, products, equipment, or options that customers can book along with the regular appointment created via Bookly. These additional items can affect the overall price and duration of the appointment as selected by the client.', 'https://codecanyon.net/item/bookly-service-extras-addon/15552320', 'https://s3.envato.com/files/437367975/icon80x80%20(1).png', 'https://s3.envato.com/files/437367976/Service-Extras-590x300.jpg', 49.00, 4044, 4.49, 37, '2016-04-01 15:29:11', 1, '2025-01-22 09:36:56'),
(4, 17328208, 'plugin', 0, 0, NULL, 'Bookly Locations (Add-on)', 'bookly-addon-locations', 'Does your company operate in more than one place? Bookly Locations (Add-on) makes it possible to associate staff members and services with different locations, so your clients can pick where they prefer to receive services before they schedule a date and time for their visit.\r\n', 'https://codecanyon.net/item/bookly-locations-addon/17328208', 'https://s3.envato.com/files/437370601/icon80x80%20(2).png', 'https://s3.envato.com/files/437370602/Locations-590x300.jpg', 39.00, 3536, 4.46, 35, '2016-08-03 17:49:31', 1, '2025-01-22 09:36:56'),
(5, 17367838, 'plugin', 0, 0, NULL, 'Bookly Chain Appointments (Add-on)', 'bookly-addon-chain-appointments', 'Let your clients book several consecutive appointments in one visit. With the Bookly Chain Appointments (Add-on), your clients can choose multiple services from different staff members at the first step of the booking process. Bookly will find available time slots when all services can be delivered sequentially during a single visit.', 'https://codecanyon.net/item/bookly-chain-appointments-addon/17367838', 'https://s3.envato.com/files/437373852/icon80x80%20(3).png', 'https://s3.envato.com/files/437373854/Chain-Appointments-590x300.jpg', 29.00, 1560, 4.80, 5, '2016-08-09 17:40:29', 1, '2025-01-22 09:36:56'),
(6, 17457141, 'plugin', 0, 0, NULL, 'Bookly Multiply Appointments (Add-on)', 'bookly-addon-multiply-appointments', 'Let your clients determine the length of their visit by booking back to back sessions of the same service. Bookly Multiply Appointments (Add-on) makes it possible for your clients to select a number of appointments they would like to get in a row with the same service provider. Bookly will automatically calculate the price of such reservation and offer time slots that can accommodate the stated number of identical appointments.', 'https://codecanyon.net/item/bookly-multiply-appointments-addon/17457141', 'https://s3.envato.com/files/437382095/icon80x80%20(4).png', 'https://s3.envato.com/files/437382096/Multiply-Appointments-590x300.jpg', 29.00, 1050, 4.00, 3, '2016-08-16 16:02:12', 1, '2025-01-22 09:36:56'),
(7, 17956131, 'plugin', 0, 0, NULL, 'Bookly Deposit Payments (Add-on)', 'bookly-addon-deposit-payments', 'Do you want to minimize the number of missed appointments and reduce cancellations? With the Bookly Deposit Payments (Add-on), you can require clients to pay a deposit at the time of booking to secure their appointment. By collecting a portion of the service cost in advance, you can minimize the risk of no-shows and ensure that the client is committed to their appointment. The remaining amount can then be paid offline when the client arrives for their appointment.', 'https://codecanyon.net/item/bookly-deposit-payments-addon/17956131', 'https://s3.envato.com/files/437382478/icon80x80%20(5).png', 'https://s3.envato.com/files/437382479/Deposit-Payments-2-590x300.jpg', 39.00, 2129, 3.75, 12, '2016-09-22 18:11:00', 1, '2025-01-22 09:36:56'),
(8, 18611122, 'plugin', 0, 0, NULL, 'Bookly Special Days (Add-on)', 'bookly-addon-special-days', 'Bookly Special Days (Add-on) enables you to change the default working hours of your staff on specific days of the year. This means you can create customized work schedules that differ from the regular ones, such as shorter or longer workdays, including breaks. These special days’ working hours will be taken into account when Bookly checks the service provider’s availability, providing your clients with accurate booking times.', 'https://codecanyon.net/item/bookly-special-days-addon/18611122', 'https://s3.envato.com/files/437382756/icon80x80%20(6).png', 'https://s3.envato.com/files/437382758/Special-Days-590x300.jpg', 39.00, 3463, 4.53, 19, '2016-11-07 01:25:43', 1, '2025-01-22 09:36:56'),
(9, 18704535, 'plugin', 0, 0, NULL, 'Bookly Special Hours (Add-on)', 'bookly-addon-special-hours', 'Do you want to offer flexible pricing options for your services? With the Bookly Special Hours (Add-on), you can easily set up dynamic pricing based on the time of day or day of the week. You can offer discounted rates for morning appointments or increase prices for evening or weekend bookings. This allows you to tailor your pricing to the needs of your business and customers.', 'https://codecanyon.net/item/bookly-special-hours-addon/18704535', 'https://s3.envato.com/files/437383025/icon80x80%20(7).png', 'https://s3.envato.com/files/437383027/Special-Hours-590x300.jpg', 29.00, 845, 4.33, 6, '2016-11-09 01:22:54', 1, '2025-01-22 09:36:56'),
(10, 18874038, 'plugin', 0, 0, NULL, 'Bookly Service Schedule (Add-on)', 'bookly-addon-service-schedule', 'Do you offer unique types of services that are only available during specific times or days? With the Bookly Service Schedule (Add-on), you can easily limit the availability of your services to specific hours or days. This allows staff members to follow their regular schedules but booking times for a specific service only appear in the Bookly form when they overlap with the staff’s working hours.', 'https://codecanyon.net/item/bookly-service-schedule-addon/18874038', 'https://s3.envato.com/files/437383322/icon80x80%20(8).png', 'https://s3.envato.com/files/437383325/590x300.jpg', 29.00, 3738, 4.28, 18, '2016-11-22 05:03:19', 1, '2025-01-22 09:36:56'),
(11, 19497634, 'plugin', 0, 0, NULL, 'Bookly Recurring Appointments (Add-on)', 'bookly-addon-recurring-appointments', 'Do you want to streamline your clients’ booking experience and encourage them to schedule regular visits? With the Bookly Recurring Appointments (Add-on), you can easily allow clients to schedule appointments weeks or months in advance. This feature allows you to automate the process of creating a series of appointments at a custom repeat interval, making it simple for clients to schedule regular appointments with just a few clicks in the Bookly booking form.', 'https://codecanyon.net/item/bookly-recurring-appointments-addon/19497634', 'https://s3.envato.com/files/437383633/icon80x80%20(9).png', 'https://s3.envato.com/files/437383634/Recurring-appointments-590x300.jpg', 39.00, 2151, 3.86, 14, '2017-02-23 17:42:00', 1, '2025-01-22 09:36:56'),
(12, 19617518, 'plugin', 0, 0, NULL, 'Bookly PayPal Payments Standard (Add-on)', 'bookly-addon-paypal-payments-standard', 'If you’re looking for a hassle-free way to process online payments during the booking process, Bookly PayPal Payments Standard (Add-on) is the perfect solution for you. By integrating this add-on with your Bookly PRO booking form, you can offer your customers a secure and popular payment gateway to pay via credit card or PayPal account. With all payments processed through PayPal, you can rest assured that the transaction is safe and reliable.', 'https://codecanyon.net/item/bookly-paypal-payments-standard-addon/19617518', 'https://s3.envato.com/files/437397531/icon80x80%20(10).png', 'https://s3.envato.com/files/437397532/PayPal-Payments-Standard-590x300.jpg', 29.00, 1966, 4.50, 8, '2017-03-22 04:29:25', 1, '2025-01-22 09:36:56'),
(13, 20005540, 'plugin', 0, 0, NULL, 'Bookly Staff Cabinet (Add-on)', 'bookly-addon-staff-cabinet', 'With the Bookly Staff Cabinet (Add-on), you can set up and provide each employee with their own personal account to manage their calendars, details, schedules, and other settings directly on the front end of your site. This eliminates the need for staff members to access the WordPress admin panel. By allowing employees to log in to their own Staff Cabinet, you can streamline the appointment management process and improve efficiency.', 'https://codecanyon.net/item/bookly-staff-cabinet-addon/20005540', 'https://s3.envato.com/files/437398500/icon80x80%20(11).png', 'https://s3.envato.com/files/437398501/Staff-Cabinet-590x300.jpg', 39.00, 2654, 4.15, 20, '2017-05-26 16:11:36', 1, '2025-01-22 09:36:56'),
(14, 20685954, 'plugin', 0, 0, NULL, 'Bookly PayU Latam (Add-on)', 'bookly-addon-payu-latam', 'Looking for a seamless and convenient way to accept online payments during booking on your website? Bookly PayU Latam (Add-on) enables integration of PayU Latam payment solution, which is a widely used payment platform in Latin America, into your Bookly PRO booking form. Your customers can easily pay online for your services using the PayU Checkout for secure transaction processing.', 'https://codecanyon.net/item/bookly-payu-latam-addon/20685954', 'https://s3.envato.com/files/437399038/icon80x80%20(12).png', 'https://s3.envato.com/files/437399039/PayU-Latam-590x300.jpg', 29.00, 116, 0.00, 2, '2017-10-04 22:22:08', 1, '2025-01-22 09:36:56'),
(15, 20917406, 'plugin', 0, 0, NULL, 'Bookly Waiting List (Add-on)', 'bookly-addon-waiting-list', 'Do you want to provide clients with the option to join a waiting list for fully-booked time slots? The Bookly Waiting List (Add-on) allows you to enable this feature in your Bookly booking system. If a cancellation occurs, you can quickly fill the open time slot by notifying the clients on the waiting list. Bookly will automatically notify the service provider about the available time slot, along with a list of customers in line. ', 'https://codecanyon.net/item/bookly-waiting-list-addon/20917406', 'https://s3.envato.com/files/437399297/icon80x80%20(13).png', 'https://s3.envato.com/files/437399298/Waiting-List-590x300.jpg', 29.00, 616, 3.67, 3, '2017-11-09 17:58:26', 1, '2025-01-22 09:36:56'),
(16, 20952783, 'plugin', 0, 0, NULL, 'Bookly Packages (Add-on)', 'bookly-addon-packages', 'Do your clients book the same service regularly? Why not offer them a package? With the Bookly Packages (Add-on), you can create deals for a particular service, allowing clients to book their favorite treatment in one package. Offering package deals can help to increase customer loyalty and encourage more sales. You can also set discounts on packages and set a validity period to ensure that customers use their package deals.', 'https://codecanyon.net/item/bookly-packages-addon/20952783', 'https://s3.envato.com/files/437399668/icon80x80%20(14).png', 'https://s3.envato.com/files/437399676/Packages-590x300.jpg', 29.00, 928, 2.71, 7, '2017-11-14 18:45:26', 1, '2025-01-22 09:36:56'),
(17, 21113698, 'plugin', 0, 0, NULL, 'Bookly 2Checkout (Add-on)', 'bookly-addon-2checkout', 'Looking for a safe and convenient way to accept online payments via your Bookly booking form? Bookly 2Checkout (Add-on) allows you to integrate the 2сheckout payment solution – a leading global payment solution that enables companies to accept credit card payments from buyers around the world – into your Bookly PRO booking form. With this payment gateway, you can offer your clients a hassle-free payment experience that’s both secure and reliable.', 'https://codecanyon.net/item/bookly-2checkout-addon/21113698', 'https://s3.envato.com/files/437400829/icon80x80%20(16).png', 'https://s3.envato.com/files/437400830/2checkout-590x300.jpg', 29.00, 45, 0.00, 0, '2017-12-12 10:30:34', 1, '2025-01-22 09:36:56'),
(18, 21113750, 'plugin', 0, 0, NULL, 'Bookly Authorize.Net (Add-on)', 'bookly-addon-authorize-net', 'Simplify the payment process for your customers by integrating a reliable and easy payment method into your website. With the Bookly Authorize.Net (Add-on), you can seamlessly integrate the Authorize.net payment solution into your Bookly PRO booking form. Your clients can pay for their appointments instantly with credit card via one of the most popular payment gateways.', 'https://codecanyon.net/item/bookly-authorizenet-addon/21113750', 'https://s3.envato.com/files/437400619/icon80x80%20(15).png', 'https://s3.envato.com/files/437400621/Authorize.net-590x300.jpg', 29.00, 247, 0.00, 0, '2017-12-12 10:30:24', 1, '2025-01-22 09:36:56'),
(19, 21113860, 'plugin', 0, 0, NULL, 'Bookly Coupons (Add-on)', 'bookly-addon-coupons', 'Would you like to improve customer loyalty, increase your sales, or attract new clients? With the Bookly Coupons (Add-on), you can create and manage promotional codes that customers can apply during checkout in the Bookly booking form. Once a coupon is used, the service price will automatically be reduced, and you’ll receive a record of the discount in the Bookly payment reports.', 'https://codecanyon.net/item/bookly-coupons-addon/21113860', 'https://s3.envato.com/files/437401292/icon80x80%20(17).png', 'https://s3.envato.com/files/437401293/Coupons-590x300.jpg', 39.00, 2579, 4.20, 5, '2017-12-12 10:39:37', 1, '2025-01-22 09:36:56'),
(20, 21113970, 'plugin', 0, 0, NULL, 'Bookly Custom Fields (Add-on)', 'bookly-addon-custom-fields', 'With the Bookly Custom Fields (Add-on), you can add extra fields of different types to the Details step of the Bookly booking form. This feature allows you to gather more specific information from your clients before they complete their booking. The custom fields will be added to the appointment details in the Bookly Calendar, and can be updated if necessary.', 'https://codecanyon.net/item/bookly-custom-fields-addon/21113970', 'https://s3.envato.com/files/437401484/icon80x80%20(18).png', 'https://s3.envato.com/files/437401485/Custom-Fields-590x300.jpg', 59.00, 6725, 4.60, 25, '2017-12-12 10:40:39', 1, '2025-01-22 09:36:56'),
(21, 21114042, 'plugin', 0, 0, NULL, 'Bookly Mollie (Add-on)', 'bookly-addon-mollie', 'Need a secure and easy method of accepting online payments through your Bookly booking form? The Bookly Mollie (Add-on) offers seamless integration with Mollie, one of the leading payment platforms in Europe. Mollie enables companies to accept credit card payments from buyers, providing a convenient and trustworthy payment experience. By integrating Mollie with Bookly PRO, you can offer your customers a reliable method of paying for their bookings directly on your website.', 'https://codecanyon.net/item/bookly-mollie-addon/21114042', 'https://s3.envato.com/files/437401872/icon80x80%20(19).png', 'https://s3.envato.com/files/437401873/Mollie-590x300.jpg', 39.00, 994, 3.67, 3, '2017-12-12 10:43:25', 1, '2025-01-22 09:36:56'),
(22, 21114096, 'plugin', 0, 0, NULL, 'Bookly Payson (Add-on)', 'bookly-addon-payson', 'Bookly Payson (Add-on) allows you to seamlessly integrate the Payson payment solution into your Bookly PRO booking form, providing customers with a convenient and secure payment experience. Payson Checkout is designed to increase the number of completed transactions and supports payment via online bank account or credit card. By integrating Payson with Bookly PRO, you can offer clients a reliable method of paying for their bookings directly on your website.', 'https://codecanyon.net/item/bookly-payson-addon/21114096', 'https://s3.envato.com/files/437888697/icon80x80%20(7).png', 'https://s3.envato.com/files/437888698/Payson-590x300.jpg', 29.00, 17, 0.00, 1, '2017-12-12 10:44:08', 1, '2025-01-22 09:36:56'),
(23, 21114146, 'plugin', 0, 0, NULL, 'Bookly Stripe (Add-on)', 'bookly-addon-stripe', 'Bookly Stripe (Add-on) enables your customers to easily and securely pay for their appointments without being redirected away from the Bookly booking form. By integrating the Stripe payment solution into your Bookly PRO booking form, you can streamline the payment process for your customers, making it quick and convenient to complete transactions.', 'https://codecanyon.net/item/bookly-stripe-addon/21114146', 'https://s3.envato.com/files/437890136/stripe80x80.png', 'https://s3.envato.com/files/437890138/Stripe-590x300.jpg', 39.00, 4327, 4.50, 16, '2017-12-12 10:46:42', 1, '2025-01-22 09:36:56'),
(24, 21344225, 'plugin', 0, 0, NULL, 'Bookly Group Booking (Add-on)', 'bookly-addon-group-booking', 'Bookly Group Booking (Add-on) allows clients to book appointments for multiple people at the same time. The add-on enables you to set the minimum and maximum capacity of the service and accept group bookings for the same appointment slot. In the Bookly booking form, clients can specify the number of people they are booking for, and Bookly ensures that the service provider can accommodate the group.', 'https://codecanyon.net/item/bookly-group-booking-addon/21344225', 'https://s3.envato.com/files/437900981/icon80x80.png', 'https://s3.envato.com/files/437900982/Group-Booking-590x300.jpg', 39.00, 5203, 4.24, 17, '2018-02-01 01:33:45', 1, '2025-01-22 09:36:56'),
(25, 21344290, 'plugin', 0, 0, NULL, 'Bookly Customer Groups (Add-on)', 'bookly-addon-customer-groups', 'The Bookly Customer Groups (Add-on) allows you to easily create and manage customer groups in Bookly, giving you the ability to set specific rules for each group. By categorizing your clients, you can control how their bookings are processed, set customized pricing for their appointments, and determine which services are visible to them in the Bookly booking form.', 'https://codecanyon.net/item/bookly-customer-groups-addon/21344290', 'https://s3.envato.com/files/437901186/icon80x80%20(1).png', 'https://s3.envato.com/files/437901187/Customer-Groups-590x300.jpg', 29.00, 595, 0.00, 1, '2018-02-01 02:03:48', 1, '2025-01-22 09:36:56'),
(26, 21344354, 'plugin', 0, 0, NULL, 'Bookly Files (Add-on)', 'bookly-addon-files', 'File uploading feature simplifies the process of collecting information required for appointments. Bookly Files (Add-on) makes it possible for the clients to attach files related to their visit directly in the Bookly online booking form. All uploaded files will be available for review and update in the booking details. Important: Bookly Files (Add-on) requires Bookly Custom Fields (Add-on) installed and activated.', 'https://codecanyon.net/item/bookly-files-addon/21344354', 'https://s3.envato.com/files/437901282/icon80x80%20(2).png', 'https://s3.envato.com/files/437901283/Files-590x300.jpg', 29.00, 922, 3.00, 9, '2018-02-01 02:07:58', 1, '2025-01-22 09:36:56'),
(27, 21574371, 'plugin', 0, 0, NULL, 'Bookly Compound Services (Add-on)', 'bookly-addon-compound-services', 'With the Bookly Compound Services (Add-on), you can combine existing services with spare time to create a separate complex service that clients can book a complete appointment with multiple services as any regular appointment. Each service included in the compound appointment will be performed by a relevant staff member who will only be reserved for their part of the service.', 'https://codecanyon.net/item/bookly-compound-services-addon/21574371', 'https://s3.envato.com/files/437881226/icon80x80%20(2).png', 'https://s3.envato.com/files/437881235/Compound-Services-590x300.jpg', 29.00, 347, 0.00, 2, '2018-03-13 06:08:47', 1, '2025-01-22 09:36:56'),
(28, 21574466, 'plugin', 0, 0, NULL, 'Bookly Customer Information (Add-on)', 'bookly-addon-customer-information', 'Need specific fields or records on a client profile in Bookly? Bookly Customer Information (Add-on) allows you to create multiple custom fields of different types that will appear on the Details step of the booking form. Once a booking is complete, the custom information entered by the client will be added to their profile in Bookly for future reference.', 'https://codecanyon.net/item/bookly-customer-information-addon/21574466', 'https://s3.envato.com/files/437901407/icon80x80%20(3).png', 'https://s3.envato.com/files/437901408/Customer-Information-590x300.jpg', 29.00, 1665, 4.75, 8, '2018-03-13 06:10:12', 1, '2025-01-22 09:36:56'),
(29, 21574566, 'plugin', 0, 0, NULL, 'Bookly Ratings (Add-on)', 'bookly-addon-ratings', 'Gathering feedback from customers is crucial for businesses to understand areas where they can improve their services. With the Bookly Ratings (Add-on), you can request feedback from clients after each appointment. By encouraging customers to rate the service they received, you can continuously strive to maintain high professional standards and meet their expectations.', 'https://codecanyon.net/item/bookly-ratings-addon/21574566', 'https://s3.envato.com/files/437889900/icon80x80%20(9).png', 'https://s3.envato.com/files/437889901/Ratings-590x300.jpg', 29.00, 437, 0.00, 2, '2018-03-13 06:19:21', 1, '2025-01-22 09:36:56'),
(30, 21841764, 'plugin', 0, 0, NULL, 'Bookly Cart (Add-on)', 'bookly-addon-cart', 'Do you want to boost your online sales even more? With With the Bookly Cart (Add-on), you can prompt your clients to book more appointments on your website. This feature enables clients to add multiple services to their cart and book them all in a single session. This way, clients can schedule additional future appointments with your business in one go. Also, the Cart step in Bookly can be customized to display summary information in a format that suits your needs.', 'https://codecanyon.net/item/bookly-cart-addon/21841764', 'https://s3.envato.com/files/437901471/icon80x80%20(4).png', 'https://s3.envato.com/files/437901472/Cart-590x300.jpg', 29.00, 2112, 5.00, 9, '2018-04-29 02:25:40', 1, '2025-01-22 09:36:56'),
(31, 21841828, 'plugin', 0, 0, NULL, 'Bookly Taxes (Add-on)', 'bookly-addon-taxes', 'Bookly Taxes (Add-on) makes it easy for you to include taxes in your service price. You can define multiple tax rates and apply them to selected services in Bookly. Once you’ve set up the tax rates, Bookly will automatically calculate and add the appropriate tax amount to the service price, resulting in a final price that includes taxes.', 'https://codecanyon.net/item/bookly-taxes-addon/21841828', 'https://s3.envato.com/files/437901541/icon80x80%20(5).png', 'https://s3.envato.com/files/437901542/Taxes-590x300.jpg', 39.00, 790, 2.50, 4, '2018-04-29 02:29:54', 1, '2025-01-22 09:36:56'),
(32, 21841856, 'plugin', 0, 0, NULL, 'Bookly Invoices (Add-on)', 'bookly-addon-invoices', 'Bookly Invoices (Add-on) allows you to automatically generate invoices for your clients upon ordered appointments in Bookly. You can choose to send payment requests when appointments are booked, approved, or received, and set a specific payment period. This feature allows you to quickly and easily collect payment from your clients and improve your cash flow.', 'https://codecanyon.net/item/bookly-invoices-addon/21841856', 'https://s3.envato.com/files/437887599/icon80x80%20(4).png', 'https://s3.envato.com/files/437887600/Invoices-590x300.jpg', 39.00, 1346, 4.60, 5, '2018-04-29 02:30:22', 1, '2025-01-22 09:36:56'),
(33, 21841871, 'plugin', 0, 0, NULL, 'Bookly Google Maps Address (Add-on)', 'bookly-addon-google-maps-address', 'The Bookly Google Maps Address (Add-on) streamlines the process of filling out address details in the booking form by using the Google Maps autocomplete service. Clients can quickly choose an address from the suggestions that appear as they type, minimizing errors and saving time. Address details entered in the Bookly booking form will be automatically saved in the Customers section for future reference.', 'https://codecanyon.net/item/bookly-google-maps-address-addon/21841871', 'https://s3.envato.com/files/437901578/icon80x80%20(6).png', 'https://s3.envato.com/files/437901579/Google-Maps-Address-590x300.jpg', 29.00, 555, 4.67, 3, '2018-04-29 02:45:11', 1, '2025-01-22 09:36:56'),
(34, 22060579, 'plugin', 0, 0, NULL, 'Bookly Advanced Google Calendar (Add-on)', 'bookly-addon-advanced-google-calendar', 'With the Advanced Google Calendar (Add-on), you can enjoy a complete bidirectional synchronization between Bookly Calendar and Google Calendar. This ensures that all appointments can be viewed and managed seamlessly in both calendars. Bookings made through Bookly are automatically synced to your Google Calendar, and any new events, updates, or cancellations made in your Google Calendar are instantly reflected in Bookly.', 'https://codecanyon.net/item/bookly-advanced-google-calendar-addon/22060579', 'https://s3.envato.com/files/437880953/icon80x80.png', 'https://s3.envato.com/files/437880955/Advanced-Google-Calendar-590x300.jpg', 49.00, 3784, 4.53, 19, '2018-06-06 04:37:53', 1, '2025-01-22 09:36:56'),
(35, 22060627, 'plugin', 0, 0, NULL, 'Bookly Customer Cabinet (Add-on)', 'bookly-addon-customer-cabinet', 'Looking for a way to provide your clients with online access to their bookings? Bookly Customer Cabinet (Add-on) allows you to set up a secure, personal customer account on your website where clients can view and manage their appointments and profile information. This includes the ability to reschedule and cancel appointments, view payments, and update personal information.', 'https://codecanyon.net/item/bookly-customer-cabinet-addon/22060627', 'https://s3.envato.com/files/437881780/icon80x80%20(3).png', 'https://s3.envato.com/files/437881782/Customer-Cabinet-590x300.jpg', 29.00, 2433, 4.29, 14, '2018-06-06 04:39:24', 1, '2025-01-22 09:36:56'),
(36, 22060703, 'plugin', 0, 0, NULL, 'Bookly Custom Duration (Add-on)', 'bookly-addon-custom-duration', 'Bookly Custom Duration (Add-on) allows your clients to have more control over their bookings by choosing how long they would like their appointments to last. This feature is especially useful for services that may require more time than the default duration, such as meetings or conferences. When clients book services with flexible duration, they can select the length of their appointment at the beginning of the booking process in the Bookly form, and the price will be calculated accordingly.', 'https://codecanyon.net/item/bookly-custom-duration-addon/22060703', 'https://s3.envato.com/files/437901822/icon80x80%20(7).png', 'https://s3.envato.com/files/437901823/Custom-Duration-590x300.jpg', 29.00, 1792, 4.43, 7, '2018-06-06 04:42:30', 1, '2025-01-22 09:36:56'),
(37, 22060797, 'plugin', 0, 0, NULL, 'Bookly PayUbiz (Add-on)', 'bookly-addon-payu-biz', 'If you want to accept and manage online payments from your clients in India, PayUbiz is a popular payment gateway that can help. With the Bookly PayUbiz (Add-on), you can easily integrate PayUbiz method into your Bookly PRO booking form and offer your customers a convenient way to pay instantly for their appointments.', 'https://codecanyon.net/item/bookly-payubiz-addon/22060797', 'https://s3.envato.com/files/437888863/icon80x80%20(8).png', 'https://s3.envato.com/files/437888864/PayUbiz-590x300.jpg', 29.00, 23, 0.00, 1, '2018-06-06 04:52:32', 1, '2025-01-22 09:36:56'),
(38, 22999600, 'plugin', 0, 0, NULL, 'Bookly Tasks (Add-on) ', 'bookly-addon-tasks', 'Bookly Tasks (Add-on) offers a solution for businesses that provide services without requiring clients to select a specific day and time. With this feature, clients and administrators can create and manage a list of tasks or unscheduled appointments within the Bookly admin area. For instance, employees can set a task to arrange a meeting with a specific client, and once it’s done, they can schedule the date and time, which will automatically convert the task into an appointment.', 'https://codecanyon.net/item/bookly-tasks-addon/22999600', 'https://s3.envato.com/files/437890581/icon80x80%20(10).png', 'https://s3.envato.com/files/437890582/Tasks-590x300.jpg', 29.00, 557, 0.00, 2, '2018-12-12 00:17:51', 1, '2025-01-22 09:36:56'),
(39, 22999632, 'plugin', 0, 0, NULL, 'Bookly Collaborative Services (Add-on)', 'bookly-addon-collaborative-services', 'Do you offer services that involve two or more staff members working together or shared resources? With the Bookly Collaborative Services (Add-on), you can create and sell complex services that involve multiple employees and resources, while your clients easily book a single service they need. Whether your employees work together to provide a service or need to use shared resources in an appointment, Bookly will make sure everything is properly scheduled.', 'https://codecanyon.net/item/bookly-collaborative-services-addon/22999632', 'https://s3.envato.com/files/437881105/icon80x80%20(1).png', 'https://s3.envato.com/files/437881106/Collaborative-Services-590x300.jpg', 39.00, 962, 4.50, 4, '2018-12-12 00:22:29', 1, '2025-01-22 09:36:56'),
(40, 23324001, 'plugin', 0, 0, NULL, 'Bookly Custom Statuses (Add-on)', 'bookly-addon-custom-statuses', 'If you need to manage your online bookings more efficiently and want to assign custom labels to your Bookly appointments, you can use Bookly Custom Statuses (Add-on). When editing an appointment, you can select a custom status from the list you created, allowing you to add more specific information to the appointment. You can also set up email notifications that correspond to each custom appointment status.', 'https://codecanyon.net/item/bookly-custom-statuses-addon/23324001', 'https://s3.envato.com/files/437902454/icon80x80%20(8).png', 'https://s3.envato.com/files/437902455/Custom-Statuses-590x300.jpg', 29.00, 625, 5.00, 3, '2019-02-18 20:10:01', 1, '2025-01-22 09:36:56'),
(41, 23350952, 'plugin', 0, 0, NULL, 'Bookly Outlook Calendar (Add-on)', 'bookly-addon-outlook-calendar', 'Bookly Outlook Calendar (Add-on) enables a complete bidirectional synchronization between Bookly Calendar and Outlook Calendar, ensuring seamless management of appointments across both platforms. With this add-on, appointments made through Bookly will be automatically added to the linked Outlook Calendar, while updates, cancellations, and new events from Outlook Calendar will be immediately reflected in Bookly.', 'https://codecanyon.net/item/bookly-outlook-calendar-addon/23350952', 'https://s3.envato.com/files/437888057/icon80x80%20(5).png', 'https://s3.envato.com/files/437888058/Outlook-Calendar-590x300.jpg', 49.00, 1198, 3.40, 5, '2019-02-21 23:33:34', 1, '2025-01-22 09:36:56'),
(42, 24219988, 'plugin', 0, 0, NULL, 'Bookly PayPal Checkout (Add-on)', 'bookly-addon-paypal-checkout', 'Bookly PayPal Checkout (Add-on) provides you with the ability to accept secure online payments at the time of booking through one of the most popular payment gateways. With this add-on, you can seamlessly integrate the PayPal payment option into your Bookly PRO booking form. By offering this convenient payment option to your customers, they can easily purchase your services with just a few clicks.', 'https://codecanyon.net/item/bookly-paypal-checkout-addon/24219988', 'https://s3.envato.com/files/437888402/icon80x80%20(6).png', 'https://s3.envato.com/files/437888403/PayPal-Checkout-590x300.jpg', 29.00, 707, 0.00, 1, '2019-07-30 18:31:46', 1, '2025-01-22 09:36:56'),
(43, 29936495, 'plugin', 0, 0, NULL, 'Bookly Discounts (Add-on)', 'bookly-addon-discounts', 'Providing discounts is a proven method to attract customers and boost sales. Bookly Discounts (Add-on) enables you to create automatic conditional discounts based on various factors like the number of customers or services booked. Once the booking details meet the conditions you set, the discounted price will be automatically applied, and customers will see the reduced price instantly. ', 'https://codecanyon.net/item/bookly-discounts-addon/29936495', 'https://s3.envato.com/files/437902644/icon80x80%20(9).png', 'https://s3.envato.com/files/437902653/Discounts-590x300.jpg', 29.00, 413, 0.00, 0, '2021-01-05 01:18:25', 1, '2025-01-22 09:36:56'),
(44, 34925755, 'plugin', 0, 0, NULL, 'Bookly Mailchimp (Add-on)', 'bookly-addon-mailchimp', 'Bookly Mailchimp (Add-on) offers a seamless integration between your Bookly booking system and your Mailchimp account, one of the most popular email marketing platforms available. With this integration, you can easily automate your email campaigns and build strong relationships with your customers. New customers in Bookly will be automatically added as new subscribers to your Mailchimp mailing list, allowing you to easily deliver targeted messages that drive sales and engagement.', 'https://codecanyon.net/item/bookly-mailchimp-addon/34925755', 'https://s3.envato.com/files/437902744/icon80x80%20(10).png', 'https://s3.envato.com/files/437902745/Mailchimp-590x300.jpg', 29.00, 172, 0.00, 2, '2021-11-24 03:10:56', 1, '2025-01-22 09:36:56');
