(713, 'bookly_cloud_products', 'a:10:{i:0;a:8:{s:2:\"id\";s:3:\"sms\";s:12:\"pro_required\";b:0;s:9:\"accept_pc\";b:0;s:8:\"icon_url\";s:41:\"https://i.bookly.info/cloud/sms_96x96.png\";s:7:\"version\";s:4:\"18.6\";s:6:\"rating\";s:3:\"5.0\";s:6:\"button\";b:1;s:5:\"texts\";a:8:{s:5:\"title\";s:26:\"SMS Уведомления\";s:5:\"price\";s:53:\"Оплата по мере использования\";s:11:\"description\";s:821:\"<p>С помощью сервиса <b>SMS Уведомлений</b> вы сможете информировать своих клиентов и сотрудников о бронированиях, сократите количество неявившихся клиентов и незабронированных интервалов. Сервис предоставляет множество кодов, которые вы можете использовать для <a href=\"https://support.booking-wp-plugin.com/hc/en-us/articles/212411309\" target=\"_blank\">персонализации</a> ваших текстовых сообщений.</p><p>Пополните свой баланс одной из стандартных сумм и больше не упускайте ни одной записи.</p>\";s:9:\"action-on\";s:12:\"Начать\";s:10:\"action-off\";s:18:\"Отключить\";s:20:\"action-revert-cancel\";s:46:\"Я хочу оставить свой план\";s:11:\"info-button\";s:22:\"Стоимость SMS\";s:10:\"info-title\";s:22:\"Стоимость SMS\";}}i:1;a:8:{s:2:\"id\";s:6:\"stripe\";s:12:\"pro_required\";b:0;s:9:\"accept_pc\";b:0;s:8:\"icon_url\";s:44:\"https://i.bookly.info/cloud/stripe_96x96.png\";s:7:\"version\";s:4:\"18.6\";s:6:\"rating\";s:3:\"5.0\";s:6:\"button\";b:1;s:5:\"texts\";a:8:{s:5:\"title\";s:40:\"Платёжная система Stripe\";s:5:\"price\";s:90:\"<small>Комиссия</small> 0.9% <small>за каждую транзакцию</small>\";s:11:\"description\";s:535:\"<p>Активировав <b>Stripe</b>, Вы сможете интегрировать платёжную систему <a href=\"https://stripe.com/\" target=\"_blank\">Stripe</a> в форму бронирования Bookly для обработки онлайн-платежей.</p><p>Нажмите на кнопку <b>Начать</b>, чтобы подключить Bookly к Вашей учётной записи Stripe и позволить клиентам мгновенно оплачивать ваши услуги.</p>\";s:9:\"action-on\";s:12:\"Начать\";s:10:\"action-off\";s:18:\"Отключить\";s:20:\"action-revert-cancel\";s:46:\"Я хочу оставить свой план\";s:11:\"info-button\";s:18:\"Подробнее\";s:10:\"info-title\";s:18:\"Настройка\";}}i:2;a:9:{s:2:\"id\";s:6:\"zapier\";s:12:\"pro_required\";b:0;s:9:\"accept_pc\";b:0;s:8:\"icon_url\";s:44:\"https://i.bookly.info/cloud/zapier-96x96.png\";s:7:\"version\";s:4:\"18.7\";s:6:\"rating\";s:3:\"5.0\";s:6:\"button\";b:1;s:5:\"texts\";a:8:{s:5:\"title\";s:6:\"Zapier\";s:5:\"price\";s:32:\"Ваш план подписки\";s:11:\"description\";s:1171:\"<p><b><a href=\"https://zapier.com/\" target=\"_blank\">Zapier</a></b> позволяет автоматически запускать действия в ваших любимых облачных приложениях при определённых событиях в Bookly: когда создаются или обновляются бронирования, и при добавлении новых клиентов.</p>\n<p>Вы можете бесплатно попробовать <b>интеграцию с Zapier</b> в течение 7 дней, чтобы больше узнать о возможностях и преимуществах сервиса. По истечении пробного периода с вас будет взиматься плата согласно условиям выбранного тарифного плана.</p>\n<p>Выберите план подписки, нажмите на кнопку <b>7 дней бесплатно</b> или <b>Начать</b> чтобы настроить соединение между Bookly и Zapier и автоматизировать ваши рабочие процессы.</p>\";s:9:\"action-on\";s:29:\"7 дней бесплатно\";s:10:\"action-off\";s:33:\"Отменить подписку\";s:20:\"action-revert-cancel\";s:35:\"Сохранить подписку\";s:11:\"info-button\";s:18:\"Подробнее\";s:10:\"info-title\";s:30:\"Интеграция с Zapier\";}s:6:\"prices\";a:6:{i:0;a:3:{s:2:\"id\";s:1:\"1\";s:7:\"caption\";s:99:\"$24<sup>.99</sup> в месяц<br/><small class=\"text-muted\">200 Действий /мес.</small>\";s:4:\"tags\";a:0:{}}i:1;a:3:{s:2:\"id\";s:1:\"2\";s:7:\"caption\";s:99:\"$59<sup>.99</sup> в месяц<br/><small class=\"text-muted\">500 Действий /мес.</small>\";s:4:\"tags\";a:1:{i:0;s:10:\"best_offer\";}}i:2;a:3:{s:2:\"id\";s:1:\"3\";s:7:\"caption\";s:102:\"$124<sup>.99</sup> в месяц<br/><small class=\"text-muted\">1 100 Действий /мес.</small>\";s:4:\"tags\";a:0:{}}i:3;a:3:{s:2:\"id\";s:1:\"4\";s:7:\"caption\";s:102:\"$249<sup>.99</sup> в месяц<br/><small class=\"text-muted\">2 300 Действий /мес.</small>\";s:4:\"tags\";a:0:{}}i:4;a:3:{s:2:\"id\";s:1:\"5\";s:7:\"caption\";s:103:\"$999<sup>.99</sup> в месяц<br/><small class=\"text-muted\">12 000 Действий /мес.</small>\";s:4:\"tags\";a:0:{}}i:5;a:3:{s:2:\"id\";s:1:\"6\";s:7:\"caption\";s:105:\"$1,499<sup>.99</sup> в месяц<br/><small class=\"text-muted\">20 000 Действий /мес.</small>\";s:4:\"tags\";a:0:{}}}}i:3;a:9:{s:2:\"id\";s:4:\"cron\";s:12:\"pro_required\";b:0;s:9:\"accept_pc\";b:0;s:8:\"icon_url\";s:42:\"https://i.bookly.info/cloud/cron_96x96.png\";s:7:\"version\";s:4:\"20.9\";s:6:\"rating\";s:3:\"5.0\";s:6:\"button\";b:0;s:5:\"texts\";a:8:{s:5:\"title\";s:10:\"Cloud Cron\";s:5:\"price\";s:32:\"Ваш план подписки\";s:11:\"description\";s:635:\"<p>Активировав <b>Cloud Cron</b>, вы можете быть уверены, что Bookly выполнит все ваши запланированные действия (email и SMS уведомления, SMS-рассылки, автоматическое изменение статуса встречи) без каких-либо дополнительных настроек.</p>\n\n<p>Чтобы активировать Cloud Cron, нажмите на кнопку <b>7 дней бесплатно</b> или <b>Начать</b> и расширьте свои возможности в планировании.</p>\";s:9:\"action-on\";s:29:\"7 дней бесплатно\";s:10:\"action-off\";s:33:\"Отменить подписку\";s:20:\"action-revert-cancel\";s:35:\"Сохранить подписку\";s:11:\"info-button\";s:0:\"\";s:10:\"info-title\";s:0:\"\";}s:6:\"prices\";a:1:{i:0;a:3:{s:2:\"id\";s:1:\"8\";s:7:\"caption\";s:32:\"$11<sup>.99</sup> в год<br/>\";s:4:\"tags\";a:0:{}}}}i:4;a:8:{s:2:\"id\";s:5:\"voice\";s:12:\"pro_required\";b:0;s:9:\"accept_pc\";b:0;s:8:\"icon_url\";s:43:\"https://i.bookly.info/cloud/voice_96x96.png\";s:7:\"version\";s:4:\"21.3\";s:6:\"rating\";s:3:\"5.0\";s:6:\"button\";b:1;s:5:\"texts\";a:8:{s:5:\"title\";s:41:\"Голосовые Уведомления\";s:5:\"price\";s:53:\"Оплата по мере использования\";s:11:\"description\";s:424:\"С помощью <b>Голосовых Уведомлений</b> вы можете более эффективно информировать своих клиентов о предстоящих записях. Ваши клиенты будут получать автоматические звонки с текстом, который вы можете настроить для различных сценариев.\";s:9:\"action-on\";s:12:\"Начать\";s:10:\"action-off\";s:18:\"Отключить\";s:20:\"action-revert-cancel\";s:46:\"Я хочу оставить свой план\";s:11:\"info-button\";s:18:\"Стоимость\";s:10:\"info-title\";s:41:\"Голосовые уведомления\";}}i:5;a:9:{s:2:\"id\";s:6:\"square\";s:12:\"pro_required\";b:1;s:9:\"accept_pc\";b:0;s:8:\"icon_url\";s:44:\"https://i.bookly.info/cloud/square_96x96.jpg\";s:7:\"version\";s:4:\"21.3\";s:6:\"rating\";s:3:\"5.0\";s:6:\"button\";b:1;s:5:\"texts\";a:8:{s:5:\"title\";s:40:\"Платёжная система Square\";s:5:\"price\";s:32:\"Ваш план подписки\";s:11:\"description\";s:546:\"<p>Активировав <b>Square Payments</b>, Вы сможете интегрировать платёжную систему <a href=\"https://squareup.com/\" target=\"_blank\">Square</a> в форму бронирования Bookly для обработки онлайн-платежей.</p><p>Нажмите на кнопку <b>7 дней бесплатно</b> или <b>Начать</b>, чтобы включить Square payments и позволить клиентам мгновенно оплачивать ваши услуги.</p>\";s:9:\"action-on\";s:29:\"7 дней бесплатно\";s:10:\"action-off\";s:33:\"Отменить подписку\";s:20:\"action-revert-cancel\";s:35:\"Сохранить подписку\";s:11:\"info-button\";s:18:\"Подробнее\";s:10:\"info-title\";s:40:\"Платёжная система Square\";}s:6:\"prices\";a:1:{i:0;a:3:{s:2:\"id\";s:1:\"9\";s:7:\"caption\";s:32:\"$29<sup>.99</sup> в год<br/>\";s:4:\"tags\";a:0:{}}}}i:6;a:9:{s:2:\"id\";s:4:\"gift\";s:12:\"pro_required\";b:1;s:9:\"accept_pc\";b:0;s:8:\"icon_url\";s:42:\"https://i.bookly.info/cloud/gift_96x96.png\";s:7:\"version\";s:4:\"21.4\";s:6:\"rating\";s:3:\"5.0\";s:6:\"button\";b:1;s:5:\"texts\";a:8:{s:5:\"title\";s:31:\"Подарочные Карты\";s:5:\"price\";s:32:\"Ваш план подписки\";s:11:\"description\";s:559:\"<p>Создавайте подарочные карты с предустановленным депозитом, который ваши клиенты смогут использовать в качестве метода оплаты во время онлайн-бронирования.</p><p>Чтобы активировать функцию Подарочные Карты, нажмите на кнопку <b>7 дней бесплатно</b> или <b>Начать</b> и предлагайте ваучеры клиентам через Bookly.</p>\";s:9:\"action-on\";s:29:\"7 дней бесплатно\";s:10:\"action-off\";s:33:\"Отменить подписку\";s:20:\"action-revert-cancel\";s:35:\"Сохранить подписку\";s:11:\"info-button\";s:18:\"Подробнее\";s:10:\"info-title\";s:31:\"Подарочные Карты\";}s:6:\"prices\";a:1:{i:0;a:3:{s:2:\"id\";s:2:\"10\";s:7:\"caption\";s:32:\"$29<sup>.99</sup> в год<br/>\";s:4:\"tags\";a:0:{}}}}i:7;a:9:{s:2:\"id\";s:8:\"whatsapp\";s:12:\"pro_required\";b:0;s:9:\"accept_pc\";b:0;s:8:\"icon_url\";s:46:\"https://i.bookly.info/cloud/whatsapp_96x96.png\";s:7:\"version\";s:4:\"21.5\";s:6:\"rating\";s:3:\"5.0\";s:6:\"button\";b:1;s:5:\"texts\";a:8:{s:5:\"title\";s:31:\"WhatsApp Уведомления\";s:5:\"price\";s:32:\"Ваш план подписки\";s:11:\"description\";s:1192:\"<p>Информируйте клиентов и сотрудников о деталях бронирования с помощью мгновенных <b>WhatsApp сообщений</b>. Благодаря функции WhatsApp, интегрированной в Bookly, вы можете отправлять настраиваемые уведомления и напоминания для различных сценариев.</p>\n\n<p>Чтобы использовать эту интеграцию, у вас <a href=\"https://support.booking-wp-plugin.com/hc/en-us/articles/10053650125202\" target=\"_blank\">должен быть</a> аккаунт разработчика Facebook. Мы рекомендуем вам сначала зарегистрироваться и настроить учетную запись Meta Business. Затем выберите план подписки, нажмите на кнопку <b>7 дней бесплатно</b> или <b>Начать</b>, чтобы активировать функцию WhatsApp Уведомления и постоянно поддерживать связь с клиентами и сотрудниками.</p>\";s:9:\"action-on\";s:29:\"7 дней бесплатно\";s:10:\"action-off\";s:33:\"Отменить подписку\";s:20:\"action-revert-cancel\";s:35:\"Сохранить подписку\";s:11:\"info-button\";s:18:\"Подробнее\";s:10:\"info-title\";s:31:\"WhatsApp Уведомления\";}s:6:\"prices\";a:6:{i:0;a:3:{s:2:\"id\";s:2:\"11\";s:7:\"caption\";s:102:\"$9<sup>.99</sup> в месяц<br/><small class=\"text-muted\">1-100 Сообщений /мес.</small>\";s:4:\"tags\";a:0:{}}i:1;a:3:{s:2:\"id\";s:2:\"16\";s:7:\"caption\";s:105:\"$17<sup>.99</sup> в месяц<br/><small class=\"text-muted\">100-200 Сообщений /мес.</small>\";s:4:\"tags\";a:1:{i:0;s:10:\"best_offer\";}}i:2;a:3:{s:2:\"id\";s:2:\"17\";s:7:\"caption\";s:105:\"$45<sup>.99</sup> в месяц<br/><small class=\"text-muted\">200-500 Сообщений /мес.</small>\";s:4:\"tags\";a:0:{}}i:3;a:3:{s:2:\"id\";s:2:\"18\";s:7:\"caption\";s:106:\"$89<sup>.99</sup> в месяц<br/><small class=\"text-muted\">500-1000 Сообщений /мес.</small>\";s:4:\"tags\";a:0:{}}i:4;a:3:{s:2:\"id\";s:2:\"19\";s:7:\"caption\";s:108:\"$177<sup>.99</sup> в месяц<br/><small class=\"text-muted\">1000-2000 Сообщений /мес.</small>\";s:4:\"tags\";a:0:{}}i:5;a:3:{s:2:\"id\";s:2:\"20\";s:7:\"caption\";s:106:\"$449<sup>.99</sup> в месяц<br/><small class=\"text-muted\"> > 2000 Сообщений /мес.</small>\";s:4:\"tags\";a:0:{}}}}i:8;a:9:{s:2:\"id\";s:20:\"mobile-staff-cabinet\";s:12:\"pro_required\";b:0;s:9:\"accept_pc\";b:0;s:8:\"icon_url\";s:44:\"https://i.bookly.info/cloud/mobile_96x96.png\";s:7:\"version\";s:4:\"22.8\";s:6:\"rating\";s:3:\"0.0\";s:6:\"button\";b:1;s:5:\"texts\";a:8:{s:5:\"title\";s:53:\"Мобильное Приложение Staff Cabinet\";s:5:\"price\";s:32:\"Ваш план подписки\";s:11:\"description\";s:742:\"<p>С помощью мобильного приложения <b>Bookly Staff Cabinet</b> ваши сотрудники смогут эффективно управлять записями и клиентами, где бы они ни находились. Они могут просматривать, создавать и переносить бронирования, а также получать доступ к важной информации о клиентах.</p>\n\n<p>Обратите внимание, что мобильное приложение Bookly Staff Cabinet в настоящее время находится в раннем доступе и доступно только для устройств Android.</p>\";s:9:\"action-on\";s:29:\"7 дней бесплатно\";s:10:\"action-off\";s:33:\"Отменить подписку\";s:20:\"action-revert-cancel\";s:35:\"Сохранить подписку\";s:11:\"info-button\";s:18:\"Подробнее\";s:10:\"info-title\";s:53:\"Мобильное Приложение Staff Cabinet\";}s:6:\"prices\";a:1:{i:0;a:3:{s:2:\"id\";s:2:\"21\";s:7:\"caption\";s:32:\"$11<sup>.99</sup> в год<br/>\";s:4:\"tags\";a:0:{}}}}i:9;a:9:{s:2:\"id\";s:14:\"service-extras\";s:12:\"pro_required\";b:1;s:9:\"accept_pc\";b:1;s:8:\"icon_url\";s:44:\"https://i.bookly.info/cloud/extras_96x96.png\";s:7:\"version\";s:4:\"23.3\";s:6:\"rating\";s:3:\"0.0\";s:6:\"button\";b:1;s:5:\"texts\";a:8:{s:5:\"title\";s:40:\"Дополнения к сервисам\";s:5:\"price\";s:32:\"Ваш план подписки\";s:11:\"description\";s:574:\"<p>Функция \"Дополнения к сервисам\" позволяет вам предлагать дополнительные товары, услуги, продукты, оборудование или опции, которые клиенты могут забронировать вместе с обычным визитом через Bookly.</p> \n<p>Эти дополнительные услуги могут повлиять на общую стоимость и продолжительность встречи, выбранную клиентом.</p>\";s:9:\"action-on\";s:29:\"7 дней бесплатно\";s:10:\"action-off\";s:33:\"Отменить подписку\";s:20:\"action-revert-cancel\";s:35:\"Сохранить подписку\";s:11:\"info-button\";s:18:\"Подробнее\";s:10:\"info-title\";s:40:\"Дополнения к сервисам\";}s:6:\"prices\";a:1:{i:0;a:3:{s:2:\"id\";s:2:\"22\";s:7:\"caption\";s:32:\"$19<sup>.99</sup> в год<br/>\";s:4:\"tags\";a:0:{}}}}}', 'auto'),
