(264, 1, '2024-12-19 11:36:23', '2024-12-19 08:36:23', '<h2>Добавили огня</h2>				\n															<img width=\"563\" height=\"844\" src=\"http://localhost/geliniu.des/wp-content/uploads/2024/12/c6d6c74b7b30ddbfe7f433b174759c86-1.jpg\" alt=\"\" />															\n		<p>Сегодняшняя съемка была настоящим приключением! Столько эмоций и великолепных кадров получилось запечатлеть. Рада, что смог поймать такие яркие моменты.</p><p>Создание этих кадров было настоящим творческим процессом. Каждый элемент фотосессии был тщательно продуман, и конечный результат полностью оправдал усилия.</p>		\n					<h2>Немного готики </h2>				\n															<img width=\"736\" height=\"930\" src=\"http://localhost/geliniu.des/wp-content/uploads/2024/12/Без-названия-1.jpeg\" alt=\"\" />															\n					<h2>Красота в простоте</h2>				\n		<p>Иногда в самых простых вещах кроется истинная красота. Эта фотосессия была о том, чтобы найти гармонию в деталях и запечатлеть их на фото.</p>		\n															<img width=\"819\" height=\"1024\" src=\"http://localhost/geliniu.des/wp-content/uploads/2024/12/photo_2024-10-15_11-08-49-3.jpg\" alt=\"\" />															\n					<h2>Элегантность и небрежность в одном кадре</h2>				\n															<img width=\"683\" height=\"1024\" src=\"http://localhost/geliniu.des/wp-content/uploads/2024/12/фотосессия-с-роялем-с-нотами.jpeg\" alt=\"\" />															\n		<p>Работать с такими талантливыми моделями - одно удовольствие! Сегодняшняя съемка прошла на одном дыхании, и результат превзошел все ожидания.</p>		\n															<img width=\"683\" height=\"1024\" src=\"http://localhost/geliniu.des/wp-content/uploads/2024/12/фотосессия-на-лавочке.jpeg\" alt=\"\" />															\n					<h2>Искусство видеть мир иначе</h2>				\n		<p>Природа - лучший декоратор. На этой фотосессии мы использовали естественные свет и окружение, чтобы подчеркнуть красоту момента.</p>		\n					<h2>Каждый кадр - уникальная история</h2>				\n		<p>Люблю эксперименты с цветом и светом. Сегодня удалось создать нечто уникальное и очень выразительное. С нетерпением жду, когда смогу поделиться результатами.</p>		\n															<img width=\"736\" height=\"920\" src=\"http://localhost/geliniu.des/wp-content/uploads/2024/12/Без-названия-2.jpeg\" alt=\"\" />															\n		<p>Больше фотосессий вы можете найти в моих социальных сетях</p>		\n					<a target=\"_blank\">\n						Instagram\n						<svg viewBox=\"0 0 448 512\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M224.1 141c-63.6 0-114.9 51.3-114.9 114.9s51.3 114.9 114.9 114.9S339 319.5 339 255.9 287.7 141 224.1 141zm0 189.6c-41.1 0-74.7-33.5-74.7-74.7s33.5-74.7 74.7-74.7 74.7 33.5 74.7 74.7-33.6 74.7-74.7 74.7zm146.4-194.3c0 14.9-12 26.8-26.8 26.8-14.9 0-26.8-12-26.8-26.8s12-26.8 26.8-26.8 26.8 12 26.8 26.8zm76.1 27.2c-1.7-35.9-9.9-67.7-36.2-93.9-26.2-26.2-58-34.4-93.9-36.2-37-2.1-147.9-2.1-184.9 0-35.8 1.7-67.6 9.9-93.9 36.1s-34.4 58-36.2 93.9c-2.1 37-2.1 147.9 0 184.9 1.7 35.9 9.9 67.7 36.2 93.9s58 34.4 93.9 36.2c37 2.1 147.9 2.1 184.9 0 35.9-1.7 67.7-9.9 93.9-36.2 26.2-26.2 34.4-58 36.2-93.9 2.1-37 2.1-147.8 0-184.8zM398.8 388c-7.8 19.6-22.9 34.7-42.6 42.6-29.5 11.7-99.5 9-132.1 9s-102.7 2.6-132.1-9c-19.6-7.8-34.7-22.9-42.6-42.6-11.7-29.5-9-99.5-9-132.1s-2.6-102.7 9-132.1c7.8-19.6 22.9-34.7 42.6-42.6 29.5-11.7 99.5-9 132.1-9s102.7-2.6 132.1 9c19.6 7.8 34.7 22.9 42.6 42.6 11.7 29.5 9 99.5 9 132.1s2.7 102.7-9 132.1z\"></path></svg>					</a>\n					<a target=\"_blank\">\n						Pinterest\n						<svg viewBox=\"0 0 496 512\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M496 256c0 137-111 248-248 248-25.6 0-50.2-3.9-73.4-11.1 10.1-16.5 25.2-43.5 30.8-65 3-11.6 15.4-59 15.4-59 8.1 15.4 31.7 28.5 56.8 28.5 74.8 0 128.7-68.8 128.7-154.3 0-81.9-66.9-143.2-152.9-143.2-107 0-163.9 71.8-163.9 150.1 0 36.4 19.4 81.7 50.3 96.1 4.7 2.2 7.2 1.2 8.3-3.3.8-3.4 5-20.3 6.9-28.1.6-2.5.3-4.7-1.7-7.1-10.1-12.5-18.3-35.3-18.3-56.6 0-54.7 41.4-107.6 112-107.6 60.9 0 103.6 41.5 103.6 100.9 0 67.1-33.9 113.6-78 113.6-24.3 0-42.6-20.