(296, 1, '2024-12-21 11:33:07', '2024-12-21 08:33:07', '<!-- wp:separator {\"opacity\":\"css\",\"className\":\"is-style-default\"} -->\n<hr class=\"wp-block-separator has-css-opacity is-style-default\"/>\n<!-- /wp:separator -->\n\n<!-- wp:image {\"width\":\"150px\",\"height\":\"150px\",\"sizeSlug\":\"large\",\"linkDestination\":\"none\",\"align\":\"center\",\"className\":\"is-style-rounded\"} -->\n<figure class=\"wp-block-image aligncenter size-large is-resized is-style-rounded\"><img src=\"https://s.w.org/images/core/5.8/portrait.jpg\" alt=\"Боковой профиль женщины в коричневой водолазке и белой сумке. Она смотрит с закрытыми глазами.\" style=\"width:150px;height:150px\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:quote {\"textAlign\":\"center\",\"className\":\"is-style-large\"} -->\n<blockquote class=\"wp-block-quote has-text-align-center is-style-large\"><!-- wp:paragraph -->\n<p>«Фотосессия с Ангелиной - это настоящее искусство. Каждое фото - это произведение искусства, запечатленное на пленке. Она умеет находить самые лучшие ракурсы и моменты, создавая настоящую магию. Мы остались в восторге от работы и с удовольствием рекомендуем всем, кто хочет получить потрясающие фотографии».</p>\n<!-- /wp:paragraph --><cite>- Анна Вонг, ЗЗ</cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:separator {\"opacity\":\"css\",\"className\":\"is-style-default\"} -->\n<hr class=\"wp-block-separator has-css-opacity is-style-default\"/>\n<!-- /wp:separator -->', '', '', 'inherit', 'closed', 'closed', '', '284-autosave-v1', '', '', '2024-12-21 11:33:07', '2024-12-21 08:33:07', '', 284, 'http://localhost/geliniu.des/?p=296', 0, 'revision', '', 0),
